import React, { FC, Suspense, lazy, useState } from 'react'
import styles from './button.module.css'
import { Link, Route } from 'react-router-dom'

const PopupTweet = lazy(() => import('../../../PopupTweet/PopupTweet'))

type props = {
  SetPostNews: any
}

const suspensePopupTweet = (SetPostNews: any) => (
  <Suspense fallback={<div>Loading...</div>}>
    {/* <PopupTweet SetPostNews={SetPostNews} /> */}
    <Route path="/popup" component={() => <PopupTweet SetPostNews={SetPostNews} />} />
  </Suspense>
)

export const Button: FC<props> = React.memo(({ SetPostNews }) => {
  const [add, setAdd] = useState(false)

  const onChange = () => {
    setAdd((prev) => !prev)
  }

  return (
    <>
      <button type="button" className={styles.btnFont} data-testid="testBtn" onChange={onChange}>
        Tweet
      </button>
      {add ? suspensePopupTweet(SetPostNews) : null}

      {/* <Suspense fallback={<div>Loading...</div>}> */}
      {/* <Route path="/popup" component={() => suspensePopupTweet(SetPostNews)} /> */}
      {/* </Suspense> */}
    </>
  )
})
